import "./Profile.css";

function Profile() {
  return (
    <section id="profile">
      <div className="profile-container">
        <div className="profile-data-container">
          <div className="profile-title font-style">내정보</div>
          {/* <div className= "prifle-" */}
        </div>
        <div className="profile-data-container"></div>
      </div>
    </section>
  );
}

export default Profile;
